import React from "react";

export default function VideoCard(props){
    return(
        <div id="video-card">
            <div id="video-img-section">
                <img id="video-img" src="" alt="" />
            </div>
        <h1>{props.item.title}</h1>
        <h2>{props.item.desc}</h2>
        <a id="video-link"><button id="video-button"></button></a>
        </div>
    )
}
